import { Card, CardBody } from "reactstrap";

const AddPost = () => {
  return (
    <div className="wrapper">
      <Card>
        <CardBody>
            <h3> Whats on you Mind</h3>
        </CardBody>
      </Card>
    </div>
  );
};
export default AddPost;
